select * from  Employees limit 5000;
-- Question 2: Display all employee first names in alphabetical order
select EmployeeFirstName from Employees order by EmployeeFirstName;
-- Question 3: Show employees who have worked at the University the shortest amount of time
select * from Employees order by yearHired;
-- Question 4: Display the names of all employees whose age is a palindrome
select EmployeeFirstName,EmployeeLastName from Employees where CONCAT(YEAR(NOW()) - birthYear) = REVERSE(CONCAT(YEAR(NOW()) - birthYear));
/*  Question 5: Write a query to display all male and female employees who were not born in 1993 and who
will not receive a performance bonus */

SELECT * FROM Employees WHERE (Gender IN ('M', 'F'))
  AND (birthYear != 1993)
  AND (PerformanceBonus IS NULL OR PerformanceBonus = 'F');
  
