alter table employees Add column EmployeeInitials varchar(50);
-- -------------------------------------
select EmployeeFirstName from employees join Departments on employees.DepartmentID = departments.DepartmentID 
where departments.location like '%Sydney%';
-- -------------------------------------
SELECT 
    e.EmployeeFirstName, 
    e.EmployeeLastName, 
    s.Salary AS OriginalSalary, 
    s.Salary * 1.10 AS NewSalary
FROM 
    Employees e
JOIN 
    SalaryClass s ON e.SalaryID = s.SalaryID;
-- -------------------------------------
select count(*) as employeeswithnobonus from employees where performancebonus = 'F';
-- -------------------------------------
SELECT 
    EmployeeFirstName,
    EmployeeLastName,
    EmployeeInitials,
    CASE 
        WHEN EmployeeInitials = REVERSE(EmployeeInitials) THEN 'Palindrome'
        ELSE 'Not a palindrome!'
    END AS PalindromeStatus
FROM 
    Employees;
-- -------------------------------------    
UPDATE Employees
SET EmployeeInitials = CONCAT(LEFT(EmployeeFirstName, 1), LEFT(EmployeeLastName, 1));
